import { useEffect, useState } from "react";
import Table from "react-bootstrap/Table";

export default function Product() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("/api/Domain/Product")
      .then((res) => res.json())
      .then((res) => {
        setData(res);
      });
  }, []);

  return (
    <div>
      <h1>Products:</h1>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>#</th>
            <th>Name</th>
            <th>Count protein</th>
            <th>Count uglevod</th>
            <th>Count fat</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            {data.map((post) => {
              return <td>{post.name}</td>;
            })}
          </tr>
        </tbody>
      </Table>

      <ul>
        {data.map((post) => {
          return <li>{post.name}</li>;
        })}
      </ul>
    </div>
  );
}
